svg.script:
function status(){
	var text =  $('#status').text();
	if (text=='UP') {
		$('#status').text('Online');
	} else {
		$('#status').text('Offline');
		$('#status').css('fill', '#ff0000');
		$('#servername').text('Server is Offline!');
		$('#servername').css('fill', '#ff0000');
		$('#address').css('fill', '#ff0000');
		$('#mapname').text('-');
		$('#mapname').css('fill', '#ff0000');
		$('#player').text('-');
		$('#player').css('fill', '#ff0000');
		$('#statusbox1').css('fill', '#ff0000');
		$('#statusbox2').css('fill', '#ff0000');
	}
};
